import React from "react";
import Quotes from "./Quotes";

const Home = () => {
  return (
    <div>
      <Quotes />
      <h1> What is the FoodyMealPlanner</h1>
      <p>
        Everyone can agree food is a source of happiness. From planning out your
        meals or choosing which cultures cuisine you want to venture into, the
        entire experience can be an adventure of its own. With Foody Meal
        Planner we bring you meals at your finger tips. The combinations are
        endless and we cater to you. By telling us what your restrictions are we
        can filter through on your behalf and make sure you are provided with
        meal plans that are special to you. Join us on your journey of happiness
        with one meal at a time.
      </p>
    </div>
  );
};

export default Home;
